class Data {  Data({      this.id,       this.companyName,       this.coins,       this.createdAt,       this.updatedAt,});  Data.fromJson(dynamic json) {    id = json['id'];    companyName = json['company_name'];    coins = json['coins'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];  }  int? id;  String ?companyName;  int?coins;  String?createdAt;  String? updatedAt;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['company_name'] = companyName;    map['coins'] = coins;    map['created_at'] = createdAt;    map['updated_at'] = updatedAt;    return map;  }}